    "High-Efficiency, Low-Temperature Regenerators for Cryocoolers Project",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T06:09:54.166883",nt"name": "high-efficiency-low-temperature-regenerators-for-cryocoolers-project",nt"isopen":
    true,nt"url": null,nt"notes": "Future NASA planetary and astrophysics missions
    will require various enhancements in multi-stage cryocoolers.  These include increased
    efficiency, reduced vibration and reductions in overall system mass and power consumption.
     For the small coolers required, pulse tube and Stirling coolers offer the best
    opportunities.  At present, the efficiency of these coolers is limited by the effectiveness
    of low-temperature-stage regenerators.  Below about 60 K, two factors play key roles
    in reducing the effectiveness of regenerators.  One is that the heat capacity of
    most materials falls rapidly with decreasing temperature, thereby, severely limiting
    the number of useful materials to a few in common use.  A second factor is that
    these commonly used materials are only available in powder form, a form known to
    raise reliability issues.  In this effort, we will address both factors.  We will
    use newly developed materials with high heat capacities at temperatures below 60
    K, higher than that of commonly used materials.  Further, we will develop a novel
    low-temperature regenerator matrix that will address both the aspect of high-efficiency
    and regenerator durability.  Both the void fraction and the ratio of surface area
    to solid fraction of the regenerator matrix will be varied to achieve high efficiency.",nt"license_title":
